import React from 'react'
import styles from './SideSection.module.css'

export default function SideSection(props) {
    return (
        <div>
            <div className={ styles.sideContainer }>
                <div className={ styles.title }><span className={ styles.topic }>{props.topic}    |</span> {props.title} <br/>  <span className={ styles.line }> ______________________________________ </span> </div>
            </div>

        </div>
    )
}
